import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import HomeScreen from './components/home.js';
import GuestListList from './components/guestlist.js';
import CreateGuest from './components/createguest.js';
import VendorScreen from './components/vendor.js';
import BridalDressList from './components/bridaldress.js';
import CatererList from './components/caterer.js';
import MakeupList from './components/makeup.js';
import PhotographerList from './components/photographer.js';
import VenueList from './components/venue.js';

const RootStack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <RootStack.Navigator initialRouteName="Home">
        <RootStack.Screen
          name="Home"
          component={HomeScreen}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="GuestList"
          component={GuestListList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="CreateGuest"
          component={CreateGuest}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="Vendor"
          component={VendorScreen}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="BridalDress"
          component={BridalDressList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="Caterer"
          component={CatererList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="Makeup"
          component={MakeupList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="Photographer"
          component={PhotographerList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
        <RootStack.Screen
          name="Venue"
          component={VenueList}
          options={{
            headerStyle: {
              backgroundColor: "#980007",
            },
            headerTintColor: '#fff',
          }}
        />
      </RootStack.Navigator>
    </NavigationContainer>
  );
};

export default App;
